import React from 'react';
import { Navbar, Nav, NavDropdown, Button, Container } from 'react-bootstrap';
import { BiLock } from 'react-icons/bi'; // <-- Cambiado de BiShieldLock a BiLock
import { Link } from 'react-router-dom';

const NavbarComponent = ({ session, onLogout }) => {
    return (
        <Navbar bg="light" expand="lg" fixed="top" className="navbar-light">
            <Container>
                <Navbar.Brand as={Link} to="/">
                    <img src="/img/logo.png" alt="PNK Inmobiliaria Logo" height="80" />
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="navbarNav" />
                <Navbar.Collapse id="navbarNav">
                    <Nav className="ms-auto">
                        <Nav.Link as={Link} to="/">Inicio</Nav.Link>
                        <Nav.Link as={Link} to="/buscar_inmuebles">Propiedades</Nav.Link>
                        <Nav.Link as={Link} to="/publicar_inmueble">Publicar</Nav.Link>
                        {!session.isLoggedIn ? (
                            <>
                                <Nav.Link as={Link} to="/registrarme">Registrarse</Nav.Link>
                                <div className="d-flex align-items-center">
                                    <Button as={Link} to="/login" variant="primary" className="me-2">
                                        Iniciar Sesión
                                    </Button>
                                    <Button as={Link} to="/recuperar" variant="secondary" className="me-2">
                                        Recuperar Contraseña
                                    </Button>
                                    <Button as={Link} to="/admin/login" variant="dark">
                                        <BiLock /> Admin {/* <-- Aquí se usa el nuevo ícono BiLock */}
                                    </Button>
                                </div>
                            </>
                        ) : (
                            <NavDropdown title={`Hola, ${session.userName}`} id="navbarDropdown">
                                <NavDropdown.Item as={Link} to="/dashboard">Mi Panel</NavDropdown.Item>
                                {(session.userType === 'gestor' || session.userType === 'admin') && (
                                    <NavDropdown.Item as={Link} to="/admin/dashboard_admin">Administración</NavDropdown.Item>
                                )}
                                <NavDropdown.Divider />
                                <NavDropdown.Item onClick={onLogout}>Cerrar Sesión</NavDropdown.Item>
                            </NavDropdown>
                        )}
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
};

export default NavbarComponent;
